import { TextField, InputAdornment } from "@material-ui/core";

const TextFormField = ({ lable, icon }) => {
  return (
    <TextField
      id="input-with-icon-textfield"
      label={lable}
      InputProps={{
        startAdornment: (
          <InputAdornment style={{ color: "#000842" }} position="start">
            {icon}
          </InputAdornment>
        ),
      }}
      variant="standard"
    />
  );
};

export default TextFormField;
